import React, { useEffect, useState } from 'react';
import {
  View,
  Text,
  StyleSheet,
  ScrollView,
  TouchableOpacity,
  StatusBar,
  Animated,
} from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';
import { SafeAreaView } from 'react-native-safe-area-context';
import { useNavigation, useRoute, RouteProp } from '@react-navigation/native';
import { StackNavigationProp } from '@react-navigation/stack';
import { RootStackParamList } from '../types/navigation';
import Icon from 'react-native-vector-icons/FontAwesome';
import { useApp } from '../contexts/AppContext';

type ResultsNavigationProp = StackNavigationProp<RootStackParamList, 'Results'>;
type ResultsRouteProp = RouteProp<RootStackParamList, 'Results'>;

const ResultsScreen: React.FC = () => {
  const navigation = useNavigation<ResultsNavigationProp>();
  const route = useRoute<ResultsRouteProp>();
  const { state, dispatch } = useApp();
  const { correct, xpGained, diagnosis, caseId } = route.params;

  const [starAnimation] = useState(new Animated.Value(0));
  const [xpAnimation] = useState(new Animated.Value(0));
  const [showConfetti, setShowConfetti] = useState(false);

  // Obtener caso
  const currentCase = state.cases.find(c => c.id === caseId);

  // Animaciones de entrada
  useEffect(() => {
    Animated.sequence([
      Animated.timing(starAnimation, {
        toValue: 1,
        duration: 800,
        useNativeDriver: true,
      }),
      Animated.timing(xpAnimation, {
        toValue: 1,
        duration: 600,
        useNativeDriver: true,
      }),
    ]).start();

    if (correct) {
      setShowConfetti(true);
      // Añadir XP
      dispatch({ type: 'ADD_XP', payload: xpGained });
      // Marcar caso como completado
      dispatch({
        type: 'COMPLETE_CASE',
        payload: { caseId, correct: true },
      });
    }
  }, []);

  // Generar estrellas
  const renderStars = () => {
    const stars = correct ? 5 : Math.floor(Math.random() * 2) + 2;
    return (
      <View style={styles.starsContainer}>
        {[1, 2, 3, 4, 5].map((star) => (
          <Animated.View
            key={star}
            style={[
              styles.star,
              {
                transform: [
                  {
                    scale: starAnimation.interpolate({
                      inputRange: [0, 1],
                      outputRange: [0, 1],
                    }),
                  },
                ],
                opacity: starAnimation,
              },
            ]}
          >
            <Icon
              name={star <= stars ? 'star' : 'star-o'}
              size={36}
              color={star <= stars ? '#FFD700' : '#ccc'}
            />
          </Animated.View>
        ))}
      </View>
    );
  };

  // Review simulada del paciente
  const reviewMessages = {
    correct: [
      "Excelente profesional. Me sentí escuchado/a y comprendido/a.",
      "Muy buena experiencia. El diagnóstico fue acertado.",
      "Recomendaría a este terapeuta sin dudarlo.",
    ],
    incorrect: [
      "Creo que el diagnóstico no fue del todo acertado.",
      "Buena atención, aunque me esperaba otro resultado.",
      "El proceso fue interesante pero necesito una segunda opinión.",
    ],
  };

  const randomReview = correct
    ? reviewMessages.correct[Math.floor(Math.random() * reviewMessages.correct.length)]
    : reviewMessages.incorrect[Math.floor(Math.random() * reviewMessages.incorrect.length)];

  return (
    <LinearGradient
      colors={correct ? ['#4CAF50', '#45a049'] : ['#FF9800', '#f57c00']}
      style={styles.container}
    >
      <StatusBar barStyle="light-content" />

      <SafeAreaView style={styles.content}>
        <ScrollView
          contentContainerStyle={styles.scrollContent}
          showsVerticalScrollIndicator={false}
        >
          {/* Resultado principal */}
          <View style={styles.resultHeader}>
            <View style={styles.iconContainer}>
              <Icon
                name={correct ? 'check-circle' : 'exclamation-circle'}
                size={80}
                color="white"
              />
            </View>
            <Text style={styles.resultTitle}>
              {correct ? '¡Diagnóstico Correcto!' : 'Diagnóstico Incorrecto'}
            </Text>
            <Text style={styles.diagnosisText}>{diagnosis}</Text>
          </View>

          {/* Estrellas */}
          {renderStars()}

          {/* Review del paciente */}
          <View style={styles.reviewCard}>
            <View style={styles.reviewHeader}>
              <View style={styles.patientAvatar}>
                <Text style={styles.patientAvatarText}>
                  {currentCase?.patient.avatar || '??'}
                </Text>
              </View>
              <View style={styles.reviewInfo}>
                <Text style={styles.patientName}>
                  {currentCase?.patient.name || 'Paciente'}
                </Text>
                <Text style={styles.reviewLabel}>Ha dejado una valoración</Text>
              </View>
            </View>
            <Text style={styles.reviewText}>"{randomReview}"</Text>
          </View>

          {/* XP Ganado */}
          <Animated.View
            style={[
              styles.xpCard,
              {
                transform: [
                  {
                    translateY: xpAnimation.interpolate({
                      inputRange: [0, 1],
                      outputRange: [50, 0],
                    }),
                  },
                ],
                opacity: xpAnimation,
              },
            ]}
          >
            <Icon name="bolt" size={24} color="#FFD700" />
            <Text style={styles.xpText}>+{xpGained} XP</Text>
            <View style={styles.xpProgress}>
              <View style={styles.xpProgressBar}>
                <View
                  style={[
                    styles.xpProgressFill,
                    { width: `${(state.user.xp / state.user.maxXp) * 100}%` },
                  ]}
                />
              </View>
              <Text style={styles.xpLevel}>Nivel {state.user.level}</Text>
            </View>
          </Animated.View>

          {/* Estadísticas del caso */}
          <View style={styles.statsCard}>
            <Text style={styles.statsTitle}>Estadísticas del caso</Text>
            <View style={styles.statsGrid}>
              <View style={styles.statItem}>
                <Text style={styles.statNumber}>
                  {currentCase?.sessions || 0}
                </Text>
                <Text style={styles.statLabel}>Sesiones</Text>
              </View>
              <View style={styles.statItem}>
                <Text style={styles.statNumber}>
                  {currentCase?.messages.filter(m => m.sender === 'user').length || 0}
                </Text>
                <Text style={styles.statLabel}>Preguntas</Text>
              </View>
              <View style={styles.statItem}>
                <Text style={styles.statNumber}>
                  {currentCase?.selectedSymptoms.length || 0}
                </Text>
                <Text style={styles.statLabel}>Síntomas</Text>
              </View>
            </View>
          </View>

          {/* Feedback de preguntas */}
          <View style={styles.feedbackCard}>
            <Text style={styles.feedbackTitle}>Análisis de tus preguntas</Text>

            <View style={styles.feedbackItem}>
              <Icon name="check-circle" size={18} color="#4CAF50" />
              <Text style={styles.feedbackText}>
                Buenas preguntas abiertas que exploraron el problema
              </Text>
            </View>

            <View style={styles.feedbackItem}>
              <Icon name="check-circle" size={18} color="#4CAF50" />
              <Text style={styles.feedbackText}>
                Mostraste empatía y comprensión
              </Text>
            </View>

            {!correct && (
              <View style={styles.feedbackItem}>
                <Icon name="exclamation-circle" size={18} color="#FF9800" />
                <Text style={styles.feedbackText}>
                  Considera explorar más el historial familiar
                </Text>
              </View>
            )}
          </View>

          {/* Botones de acción */}
          <View style={styles.actionButtons}>
            <TouchableOpacity
              style={styles.primaryButton}
              onPress={() => navigation.navigate('Desktop')}
            >
              <Icon name="home" size={18} color="white" style={styles.buttonIcon} />
              <Text style={styles.primaryButtonText}>Volver al inicio</Text>
            </TouchableOpacity>

            <TouchableOpacity
              style={styles.secondaryButton}
              onPress={() => navigation.navigate('Contacts')}
            >
              <Icon name="user-plus" size={16} color="#4A90E2" style={styles.buttonIcon} />
              <Text style={styles.secondaryButtonText}>Nuevo caso</Text>
            </TouchableOpacity>

            <TouchableOpacity style={styles.shareButton}>
              <Icon name="share-alt" size={16} color="#666" />
              <Text style={styles.shareButtonText}>Compartir logro</Text>
            </TouchableOpacity>
          </View>
        </ScrollView>
      </SafeAreaView>
    </LinearGradient>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  content: {
    flex: 1,
  },
  scrollContent: {
    paddingHorizontal: 20,
    paddingBottom: 30,
  },
  resultHeader: {
    alignItems: 'center',
    paddingVertical: 30,
  },
  iconContainer: {
    marginBottom: 20,
  },
  resultTitle: {
    fontSize: 28,
    fontWeight: '700',
    color: 'white',
    marginBottom: 10,
  },
